	('73fb4fe1-1f29-458b-bf89-56b530b49f20', 'strength-building', 'Barbell Deadlift', '{"id": "e3", "name": "Barbell Deadlift", "tips": "Focus on hip hinge movement.", "benefits": ["Increased full-body strength", "Improved power", "Enhanced core stability"], "category": "strength-building", "difficulty": "advanced", "safety_tips": ["Use a spotter", "Maintain proper form", "Wear a weightlifting belt"], "instructions": "1. Stand with feet hip-width apart. 2. Bend down and grip the barbell with an overhand grip. 3. Keep your back straight and lift the barbell off the ground. 4. Lower the barbell back to the ground with control.", "progressions": ["Romanian Deadlift", "Sumo Deadlift"], "rest_periods": "2-3 minutes", "modifications": ["Using lighter weight", "Rack pulls"], "muscle_groups": ["Glutes", "Hamstrings", "Lower Back", "Traps"], "common_mistakes": ["Rounding the back", "Using too much weight", "Not engaging the core"], "equipment_needed": ["Barbell"], "sets_reps_guidance": "1-3 sets of 5 reps"}', '2025-06-11 14:13:22.967274+00', '2025-06-11 14:13:22.967274+00'),
	('429c6647-e366-47e2-ace3-1e806ea08480', 'strength-building', 'Cable Flyes', '{"id": "e24", "name": "Cable Flyes", "tips": "Squeeze your chest at the end of each rep.", "benefits": ["Increased chest size and definition"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Maintain controlled movements"], "instructions": "1. Stand between two cable machines. 2. Extend arms out to the sides. 3. Bring your arms together in front of you. 4. Return to the starting position.", "progressions": ["Decline Cable Flyes"], "rest_periods": "45-60 seconds", "modifications": ["Using lighter weight", "Adjusting cable height"], "muscle_groups": ["Pectorals"], "common_mistakes": ["Using momentum", "Not fully extending arms"], "equipment_needed": ["Cable Machine"], "sets_reps_guidance": "3 sets of 12-15 reps"}', '2025-06-11 14:13:22.982121+00', '2025-06-11 14:13:22.982121+00'),
	('b02bd298-e1b4-4309-ae44-34bfc17633b9', 'strength-building', 'Hamstring Curls', '{"id": "e16", "name": "Hamstring Curls", "tips": "Focus on controlled movements and full range of motion.", "benefits": ["Increased hamstring size and strength"], "category": "strength-building", "difficulty": "beginner", "safety_tips": ["Maintain controlled movements"], "instructions": "1. Lie face down in the hamstring curl machine. 2. Curl your legs towards your glutes. 3. Slowly lower your legs back to the starting position.", "progressions": ["Romanian Deadlifts"], "rest_periods": "45-60 seconds", "modifications": ["Using lighter weight", "Adjusting seat height"], "muscle_groups": ["Hamstrings"], "common_mistakes": ["Using too much weight", "Not fully extending legs"], "equipment_needed": ["Hamstring Curl Machine"], "sets_reps_guidance": "3 sets of 12-15 reps"}', '2025-06-11 14:13:22.992708+00', '2025-06-11 14:13:22.992708+00'),
	('028c4a71-dacc-4c1b-9cea-fa738663a30d', 'strength-building', 'Cable Rows', '{"id": "e12", "name": "Cable Rows", "tips": "Focus on squeezing your shoulder blades together at the top of the movement.", "benefits": ["Increased back thickness", "Improved posture", "Enhanced grip strength"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Maintain controlled movements"], "instructions": "1. Sit facing the cable machine. 2. Pull the cable handle towards your chest. 3. Slowly return to the starting position.", "progressions": ["Close-Grip Cable Rows", "One-Arm Cable Rows"], "rest_periods": "60-90 seconds", "modifications": ["Using lighter weight", "Adjusting cable height"], "muscle_groups": ["Latissimus Dorsi", "Rhomboids", "Trapezius"], "common_mistakes": ["Using momentum", "Not fully extending arms"], "equipment_needed": ["Cable Machine"], "sets_reps_guidance": "3 sets of 10-15 reps"}', '2025-06-11 14:13:22.9837+00', '2025-06-11 14:13:22.9837+00'),
	('7541d54e-cb50-4a6c-a774-3dd218b53789', 'strength-building', 'Lat Pulldowns', '{"id": "e13", "name": "Lat Pulldowns", "tips": "Focus on squeezing your shoulder blades together at the top of the movement.", "benefits": ["Increased back width", "Improved grip strength"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Maintain controlled movements"], "instructions": "1. Sit facing the lat pulldown machine. 2. Pull the bar down to your chest. 3. Slowly return to the starting position.", "progressions": ["Close-Grip Lat Pulldowns", "Wide-Grip Lat Pulldowns"], "rest_periods": "60-90 seconds", "modifications": ["Using lighter weight", "Adjusting seat height"], "muscle_groups": ["Latissimus Dorsi", "Biceps", "Forearms"], "common_mistakes": ["Using momentum", "Not fully extending arms"], "equipment_needed": ["Lat Pulldown Machine"], "sets_reps_guidance": "3 sets of 10-15 reps"}', '2025-06-11 14:13:22.998353+00', '2025-06-11 14:13:22.998353+00'),
	('2fa18d04-ff41-4a85-be95-e5875dc86dc4', 'strength-building', 'Overhead Dumbbell Extensions', '{"id": "e22", "name": "Overhead Dumbbell Extensions", "tips": "Focus on squeezing your triceps at the top of the movement.", "benefits": ["Increased triceps size and strength"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Maintain controlled movements"], "instructions": "1. Hold a dumbbell in both hands overhead. 2. Lower the dumbbell behind your head by bending your elbows. 3. Extend your arms back up to the starting position.", "progressions": ["Close-Grip Bench Press"], "rest_periods": "45-60 seconds", "modifications": ["Using lighter dumbbells", "One-arm overhead extensions"], "muscle_groups": ["Triceps"], "common_mistakes": ["Using momentum", "Not fully extending arms"], "equipment_needed": ["Dumbbells"], "sets_reps_guidance": "3 sets of 10-15 reps"}', '2025-06-11 14:13:23.001661+00', '2025-06-11 14:13:23.001661+00'),
	('23f7b034-8f2c-43de-86f9-b641a5091741', 'strength-building', 'Dumbbell Bench Press', '{"id": "e2", "name": "Dumbbell Bench Press", "tips": "Squeeze your chest at the top of the movement.", "benefits": ["Increased chest strength", "Improved upper body power", "Enhanced muscle mass"], "category": "strength-building", "difficulty": "beginner", "safety_tips": ["Use a spotter if needed", "Maintain a controlled movement"], "instructions": "1. Lie on a bench with feet flat on the floor. 2. Hold dumbbells at chest height. 3. Lower dumbbells slowly to chest. 4. Push dumbbells back up to starting position.", "progressions": ["Incline Dumbbell Press", "Decline Dumbbell Press"], "rest_periods": "45-60 seconds", "modifications": ["Using lighter dumbbells", "Performing on an incline"], "muscle_groups": ["Pectorals", "Anterior Deltoids", "Triceps"], "common_mistakes": ["Arching the back", "Not lowering dumbbells all the way", "Using too much weight"], "equipment_needed": ["Dumbbells"], "sets_reps_guidance": "3 sets of 10-15 reps"}', '2025-06-11 14:13:22.999862+00', '2025-06-11 14:13:22.999862+00'),
	('1f256f90-22f4-4766-b337-f7ade53e4a40', 'strength-building', 'Pull-ups', '{"id": "e4", "name": "Pull-ups", "tips": "Focus on squeezing your shoulder blades together at the top.", "benefits": ["Increased back strength", "Improved grip strength", "Enhanced upper body power"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Ensure a secure grip", "Maintain controlled movements"], "instructions": "1. Grip the pull-up bar with an overhand grip, slightly wider than shoulder-width. 2. Hang with arms fully extended. 3. Pull yourself up until your chin is over the bar. 4. Slowly lower yourself back down.", "progressions": ["Negative Pull-ups", "Weighted Pull-ups"], "rest_periods": "60-90 seconds", "modifications": ["Assisted Pull-ups using resistance band", "Australian Pull-ups"], "muscle_groups": ["Latissimus Dorsi", "Biceps", "Forearms"], "common_mistakes": ["Using momentum", "Not fully extending arms", "Swinging"], "equipment_needed": ["Pull-up Bar"], "sets_reps_guidance": "3 sets to failure"}', '2025-06-11 14:13:23.005461+00', '2025-06-11 14:13:23.005461+00'),
	('6f4c5ec5-b585-4f00-accd-762c3b609257', 'strength-building', 'Incline Dumbbell Press', '{"id": "e7", "name": "Incline Dumbbell Press", "tips": "Focus on controlled movements and full range of motion.", "benefits": ["Increased upper chest development", "Improved shoulder definition"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Use a spotter if needed"], "instructions": "Similar to dumbbell bench press, but performed on an incline bench.", "progressions": ["Incline Barbell Press", "Decline Dumbbell Press"], "rest_periods": "60-90 seconds", "modifications": ["Using lighter dumbbells", "Decreasing incline angle"], "muscle_groups": ["Upper Pectorals", "Anterior Deltoids", "Triceps"], "common_mistakes": ["Arching the back", "Not lowering dumbbells all the way"], "equipment_needed": ["Dumbbells", "Incline Bench"], "sets_reps_guidance": "3 sets of 8-12 reps"}', '2025-06-11 14:13:23.000608+00', '2025-06-11 14:13:23.000608+00'),
	('dc91df93-ae6f-4195-b9ba-77d486c7d4fe', 'strength-building', 'Face Pulls', '{"id": "e25", "name": "Face Pulls", "tips": "Squeeze your shoulder blades together at the end of each rep.", "benefits": ["Improved posture", "Reduced risk of shoulder injuries", "Enhanced upper back development"], "category": "strength-building", "difficulty": "intermediate", "safety_tips": ["Maintain controlled movements", "Focus on proper form"], "instructions": "1. Attach a rope attachment to a high cable pulley. 2. Pull the rope towards your face, keeping your elbows high. 3. Return to the starting position.", "progressions": ["Face Pulls with added weight"], "rest_periods": "45-60 seconds", "modifications": ["Using lighter weight"], "muscle_groups": ["Rear Deltoids", "Trapezius", "Rhomboids"], "common_mistakes": ["Using momentum", "Not retracting your shoulder blades"], "equipment_needed": ["Cable Machine"], "sets_reps_guidance": "3 sets of 15-20 reps"}', '2025-06-11 14:13:23.029226+00', '2025-06-11 14:13:23.029226+00'),
	('47125443-e61d-48b8-ab22-9971a8ebbde1', 'strength-building', 'Calf Raises (Standing)', '{"id": "e17", "name": "Calf Raises (Standing)", "tips": "Focus on controlled movements and full range of motion.", "benefits": ["Increased calf size and strength"], "category": "strength-building", "difficulty": "beginner", "safety_tips": ["Maintain controlled movements"], "instructions": "1. Stand with feet shoulder-width apart. 2. Raise up onto your toes. 3. Slowly lower your heels back to the ground.", "progressions": ["Calf Raises (Seated)", "Donkey Calf Raises"], "rest_periods": "45-60 seconds", "modifications": ["Using lighter weight", "Performing on a slightly elevated surface"], "muscle_groups": ["Calves"], "common_mistakes": ["Not fully extending legs"], "equipment_needed": ["Barbell (optional)"], "sets_reps_guidance": "3 sets of 15-20 reps"}', '2025-06-11 14:13:23.033598+00', '2025-06-11 14:13:23.033598+00'),
